INSERT INTO users VALUES
  (1, 'steveTheWizard', '$2a$12$A74tKw96m82AEZpJrIEQxecZGscKayJD/hD5/I6DuqKEJoQlAlNYO', '2017-12-25 00:00:00', 'images/mage-1.jpg', 1, 1, 0, 'A mystic scholar with an unfortunate curse seeking a demon confidant to help decipher ancient tomes. Enjoys moonlit rituals and deciphering cryptic runes. If you can break the curse or at least provide some spellbinding company, swipe right. Beware of owl-themed puns.'),
  (2, 'MoonWitch9', '$2a$12$o2NP8ykiki.T11qRQOCnBeX68PhwXHprM/hxHkbAfqotWo2XT.vdW', '2017-12-25 00:00:00', 'images/mage-2.jpg', 1, 0, 1, 'Alchemy aficionado with a penchant for astral projections and cosmic spellcraft. On the quest for a demon partner to explore otherworldly dimensions. If you''re into starry-eyed adventures and seeking enlightenment in the ethereal realms, swipe right!'),
  (3, 'sharon123', '$2a$12$8HIQ9kqN0brBUfDigfSfB.9BlSsICw4LQ/tiw4U/zMW5QWtuTqMG6', '2017-12-25 00:00:00', 'images/mage-3.jpg', 1, 0, 0, 'A brooding necromancer in search of a demon companion for dark rituals and shadowy expeditions. Enjoys moonless nights and raising the undead. Looking for a demon with a taste for the macabre. Swipe right if you''re ready to embrace the darkness within.'),
  (4, 'Malgor_the_Mighty', '$2a$12$vpUb03L0WVHMfrHducL2SumogekzuPfh9Ych0Il8Zkt5Baqch7QZq', '2017-12-25 00:00:00', 'images/mage-4.jpg', 1, 0, 0, 'I AM MIGHTY.'),
  (5, 'Ignatius', '$2a$12$AEVcwDH6apiHoyJnZcgWaemY9gZ.fn2ZlTeQZKy.w4Pq7qptgyJtG', '2017-12-25 00:00:00', 'images/mage-5.jpg', 1, 0, 0, 'Wielding the abyssal arts, I seek a demon to dance with me in the moon''s shadow. Enjoys plotting world domination, summoning eldritch horrors, and dark poetry. Swipe right if you dare to explore the depths of your own darkness.'),
  (6, 'TheBeast666', '$2a$12$.nvgl/CiZLYqnf6zz4Iq4OUGEN72OmArjhz6j5BCyKQz6i9TCDBfS', '2017-12-25 00:00:00', 'images/entity-2.jpg', 0, 0, 0, '3,000 year old primordial demon looking for a powerful wizard to show me a thing or two.<ul><li>Doesn''t have human sacrifices but wants them someday.</li><li>NO TORIES.</li></ul>'),
