  (8, 'BeckyTheDryad', '$2a$12$M3CzlEMu7CqCJseuus70Ne4xAKFh795psGCgTQc1diZVL5UiYPqG.', '2017-12-25 00:00:00', 'images/entity-4.jpg', 0, 0, 0, 'Progressive wood spirit looking for a conscientious mage who cares about the environment and animal rights. Only vegans need apply, and any unsolicited pictures of your wand will get you blocked and reported.'),
  (9, 'Azazel', '$2a$12$fNhJ0RA8nAK.FVbYARXr7e8pMpR8hgLl11xkBpRdIyubrgapb6NeK', '2017-12-25 00:00:00', 'images/entity-3.jpg', 0, 0, 0, 'I just got out of a 300 year contract, so I''m really looking to take things slow. That said, if the right sorcerer were to show up, who knows haha 🤣'),
